-- Creating Data for storeing the data 

CREATE DATABASE tomato_data_analysis ;

-- Using that for futher pocesse  
use tomato_data_analysis ;

-- Creating Table and columns names with  arguments . 
CREATE TABLE `order_details` (
  `id` int(10) UNSIGNED NOT NULL,
  `order_id` int(11) NOT NULL,
  `category_id` int(11) NOT NULL,
  `sub_category_id` int(11) NOT NULL,
  `sub_sub_category_id` int(11) UNSIGNED DEFAULT 0,
  `brand_id` int(11) NOT NULL DEFAULT 0,
  `product_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL COMMENT 'customer_id',
  `quantity` int(11) NOT NULL,
  `selling_price` double NOT NULL,
  `buying_price` double NOT NULL,
  `total_buying_price` double NOT NULL,
  `total_selling_price` double NOT NULL,
  `unit_discount` double NOT NULL DEFAULT 0,
  `total_discount` double NOT NULL DEFAULT 0,
  `status` tinyint(4) NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Dumping data for table `order_details`
--
-- Data Insert queriy for upload the data inside table 

-- To view hall table 
SELECT * FROM order_details ;

-- select with where and order by 
-- This query finding the quantity more than 5 with order by created date in descending order 
SELECT * FROM order_details
WHERE quantity > 5
ORDER BY created_at DESC;

-- Group by funtion with aggregation funtion 
-- Finding total quantity for per order id with group by funtion
SELECT order_id, SUM(quantity) AS total_quantity
FROM order_details
GROUP BY order_id
ORDER BY total_quantity DESC;

-- Creating new table for runing some join querys 
CREATE TABLE customers (
  customer_id INT PRIMARY KEY,
  name VARCHAR(100),
  email VARCHAR(100),
  phone VARCHAR(20)
);

-- Inserting some data into customer table 

-- inner join to finding  the user name in table customer with using order_detail table user_id 
SELECT o.order_id, c.name AS customer_name, o.product_id,  o.quantity
FROM order_details o
INNER JOIN customers c ON o.user_id = c.customer_id;

-- Creating product table for left join pratice 

CREATE TABLE products (
  product_id INT PRIMARY KEY,
  product_name VARCHAR(100),
  description TEXT,
  price DOUBLE
);

-- Left join to finding product name with there product id 
SELECT o.order_id, p.product_name, o.quantity
FROM order_details o
LEFT JOIN products p ON o.product_id = p.product_id;

SELECT o.order_id, p.product_name, o.quantity
FROM products p
RIGHT JOIN order_details o ON o.product_id = p.product_id;

-- Subquery for finding where quantity more than 10 with  hall table 
SELECT * FROM order_details
WHERE order_id IN (
  SELECT order_id FROM order_details
  GROUP BY order_id
  HAVING quantity > 10
);

-- Use aggregate functions to finding total selling price with order id whom have selling price more than 500 
SELECT 
order_id, 
SUM(total_selling_price) AS total_sales
FROM order_details
GROUP BY order_id
HAVING SUM(total_selling_price) >500 ;

-- Using aggregate function to finding avg quantity purchase by single order_id 
SELECT product_id, AVG(quantity) AS avg_quantity
FROM order_details
GROUP BY product_id
HAVING AVG(quantity) > 5;

-- Creating new view to analysis the customer sakes summary an single order id total selling prise and avg qunatity 
CREATE VIEW customer_sales_summary AS
SELECT 
order_id, 
SUM(total_selling_price) AS total_sales,
AVG(quantity) AS avg_order_quantity
FROM order_details
GROUP BY order_id;
SELECT * FROM customer_sales_summary
ORDER BY total_sales DESC;